Description. Adult male (based on holotype WAM
T 94870
): medium-sized nemesiid spider (total length 18.4 ).

Colour
: carapace (

Fig. 
10

) light yellow-brown in thoracic region turning darker towards anterior parts, cephalic region dark reddish-brown, eye region black (

Fig. 
13

); sternum light yellow-brown, sigilla and labium largely brown (

Fig. 
12

); abdomen dorsally dark brownish-grey, mottled with small light-brown spots (

Fig. 
11

), ventrally light yellowish; chelicerae very dark reddish-brown; pedipalp segments reddish-brown, tibia somewhat lighter (
Figs 17, 18
); legs light yellowish-brown (
Figs 15, 16
).

Carapace : 7.0 long, 5.6 wide; eye group (
Fig. 13
) 1.4 wide, 0.7 long; fovea procurved (
Fig. 10
).

Sternum and labium : 4.4 long, 2.8 wide; 2 pairs of elongated sigilla in posterior half (
Fig. 12
); labium wider than long, slightly indented anteriorly (
Fig. 14
).

Maxillae : with> 50 pin-like cuspules, extending to heel (
Fig. 14
).

Chelicerae : without rastellum (
Fig. 12
), promargin with 9 large teeth, retromargin with 4 smaller teeth proximally.

Abdomen : 7.4 long, 5.0 wide (
Fig. 11
). Four spinnerets, terminal segment of posterior lateral spinnerets digitiform.

Pedipalp : length of femur 4.0, patella 2.2 , tibia 3.1 , tarsus 3.1 . Femur with 1 disto-prolateral spine; patella with 3 prolateral spines; tibia with 2 baso-ventral spines and 7–8 prolateral spines in apical half, tibia with slight distoventral depression without setae (accommodates bulb and embolus) ( Figs 17, 18 ); tarsus terminally blunt; bulb globular, embolus ca. 0.8 long, slightly curved and tapering (
Figs 17–20
).

Legs : femur I with row of 7 dorsal spines in basal half and 2 disto-prolateral spines, patella with 2 prolateral spines, metatarsi and tarsi without spines. Tibia I with large spur and megaspine, metatarsi incrassate (
Fig. 16
). Tarsi and apical half of metatarsi of legs I and II ventrally with entire dense scopulae, tarsi of legs III and IV with divided weak scopulae. Tarsi, metatarsi and tibiae with numerous dorsal trichobothria of variable length. Paired tarsal claws of legs with two rows of 7–10 teeth each; third tarsal claw reduced and very small.

Adult female (based on WAM
T 96150
): medium-sized nemesiid spider (total length 19.5 ).

Colour : light yellowish-brown with indistinctly darker cephalic region (
Fig. 21
), eye region brown; sternum, sigilla and labium uniformly light yellowish-brown; abdomen dorsally dark greyish-brown with purple tinge and mottled with small lighter small spots, ventrally light yellowish-brown; chelicerae orange-brown; pedipalps and legs uniformly light yellow-brown.

Sternum and labium : 5.0 long, 3.2 wide (
Fig. 22
); 2 pairs of indistinct elongated sigilla in posterior half, 1 pair of round sigilla at base of leg II; labium wider than long, slightly indented anteriorly.
